import React from "react";
import Button from "@mui/material/Button";
import {styled} from "@mui/material/styles";

const CustomerButton = styled(Button)({
    color: "#3f51b5",
            borderColor: "#3f51b5",
            borderWidth: "2px",
            marginTop: "20px",
            borderRadius: "20px",
            fontFamily: "Encode Sans Expanded",
            fontWeight: "bold",
    "&:hover": {
      opacity: 0.9,
      transform: "scale(0.9)",
    },
  });

export default function Resume() {
  return (
    <div id="resume" className="resume" style={{marginTop:"30px", backgroundColor:"#f8f9fa" ,marginTop:"0px", padding:"50px"}}>
      <h2 style={{margin:"0px"}}>Resume</h2>
      <div className="resume-buttons">
        <Button
          variant="outlined"
          href="#"
          style={{
            color: "black",
            border: "3px solid black",
            marginTop: "20px",
            borderRadius: "20px",
            fontFamily: "Encode Sans Expanded",
            fontWeight: "bold",
            marginRight:"20px"
          }}
        >
          <a href="" target="_blank">View resume</a>
        </Button>
        <Button
          variant="outlined"
          href="#"
          style={{
            color: "#3f51b5",
            borderColor: "#3f51b5",
            borderWidth: "2px",
            marginTop: "20px",
            borderRadius: "20px",
            fontFamily: "Encode Sans Expanded",
            fontWeight: "bold",
          }}
        >
          <a href="" download>Download Resume</a>
        </Button>
      </div>
    </div>
  );
}
